import {
    UploadOutlined,
    UserOutlined,
    VideoCameraOutlined,
} from '@ant-design/icons';
import { Layout, Menu } from 'antd';
import React, { useState } from 'react';

import './index.css'

const { Sider } = Layout;

const menuList = [
    {
        key: '/home',
        title: 'Home',
        icon: <UserOutlined />,
    },
    {
        key: '/user-manage',
        title: 'User Management',
        icon: <UserOutlined />,
        children: [
            {
                key: '/user-manage/list',
                title: 'User Lists',
                icon: <UserOutlined />,
            },
        ],
    },    {
        key: '/right-manage',
        title: 'Right Management',
        icon: <UserOutlined />,
        children: [
            {
                key: '/right-manage/role/list',
                title: 'Role Lists',
                icon: <UserOutlined />,
            },
            {
                key: '/right-manage/list',
                title: 'User Lists',
                icon: <UserOutlined />,
            },
        ],
    },
]

export default function SideMenu() {

    const [collapsed, setCollapsed] = useState(false)

    return (
        <Sider trigger={null} collapsible collapsed={false} >
            <div className="logo">Global News Release Management</div>
            <Menu
                theme="dark"
                mode="inline"
                defaultSelectedKeys={['1']}
                items={[
                    {
                        key: '1',
                        icon: <UserOutlined />,
                        label: 'nav 1',
                    },
                    {
                        key: '2',
                        icon: <VideoCameraOutlined />,
                        label: 'nav 2',
                    },
                    {
                        key: '3',
                        icon: <UploadOutlined />,
                        label: 'nav 3',
                    },
                ]}
            />
        </Sider>
    )
}
